		["UpdateId"] = 3166425654,
		["Contents"] = "{icon ability_warrior_endlessrage} ||cgreenWelcome to AngryEdit.io!\n\nAngryEdit hopes to make the tedious process of editing and sharing Angry Assignments in-game a thing of the past. Currently we support all Angry Assignments syntax except for {boss encounterID} and {journal sectionID} due to resource limitations.\n\n--\n\n{icon trade_engineering} ||cyellowCommon Angry Assignment syntax uses:\n\n-> Colors\n\nThe following colors are built in using the ||ccolor syntax:\n||cblueblue ||cgreengreen ||credred ||cyellowyellow ||corangeorange ||cpinkpink ||cpurplepurple\n\nYou can end a color span using the ||+r syntax\n    \nAdditionally you can use class colors with the ||cclass syntax:\n||cwarlockwarlocks||r are better than: ||cdruiddruids||r ||chunterhunters||r ||cmagemages||r ||cpaladinpaladins||r ||cpriestpriests||r ||croguerogues||r ||cshamanshamans||r ||cwarriorwarriors||r ||cdeathknightdeathknights||r ||cmonkmonks||r and ||cdemonhunterdemonhunters\n    \nFinally, you can use a custom color with the ||c[alpha][hex code] syntax:\n||cfff9de59this ||cffe8a628is ||cfff98365a ||cffc33124custom ||cffa1dffbcolor\n\n\n-> Icons\n\nClass icons can be added with the {class} syntax:\n{warlock}{druid}{hunter}{mage}{paladin}{priest}{rogue}{shaman}{warrior}{deathknight}{monk}{demonhunter}\n\nRaid Target icons can be added with any of the following {icon} syntax:\n(rt1-8) {rt1}{rt8} or by name {circle}{square}{x}{star}{moon}{diamond}\n\nRole icons for tanks, healers, and dps:\n{tank}{healer}{dps}\n\nSpell icons by spell ID or by icon file name: (can be found on wowhead)\n{icon 974}{icon 693}{icon 33736}{icon 71}{icon spell_holy_powerinfusion}{icon inv_misc_key_04}{icon spell_nature_lightning}\n\nAlso AA has 3 built in short named icons:\n{healthstone}/{hs} {bloodlust}/{bl} {heroism}/{hero}\n\n\n-> Spell links\n\nYou can also link spells with {spell spellid}:\n{spell 974} {spell 33555} {spell 27226}\n\n--\n\n||cff6c6c6cofficial Angry Assignments docs: https://github.com/Ermad/angry-assignments",
	},
